import React, { useState } from 'react';
import './DataWindowNav.css';
import SecondaryButton from "../../components/SecondaryButton/SecondaryButton"; 

function DataWindowNav(props:any) {
  const setShowYourSurveys = props.setShowYourSurvey
  const setShowData = props.setShowData
  return (
    <div className="datanav-container">
        <SecondaryButton width={'200px'} fontSize={'18px'} onClick={() => {
          setShowYourSurveys
        }}>Your Surveys</SecondaryButton>
        <SecondaryButton width={'200px'} fontSize={'18px'}>Survey Data</SecondaryButton>
    </div>
  )
};

export default DataWindowNav
